import './css/App.css';
import { BrowserRouter as Router, Route} from "react-router-dom"; //routes

import AdminHome from "./home";
import AdminPosts from "./posts";
import AdminInbox from "./inbox";
import AdminProfile from "./profile";

import customerHome from "./customer";
import customerRequest from "./customerRequest";
import Login from "./login";
import Register from "./register";
import seeRequests from "./seeRequests";




function App() {
  return (
    <div className="App">






      <Router>



           {/* ROUTES LANG SAKALAM */}
           <Route exact path="/adminHome" component={AdminHome} />
           <Route exact path="/adminPosts" component={AdminPosts} />
           <Route exact path="/adminInbox" component={AdminInbox} />
           <Route exact path="/adminProfile" component={AdminProfile} />
           <Route exact path="/seeRequests" component={seeRequests} />



           <Route exact path="/customer" component={customerHome} />
           <Route exact path="/customerRequest" component={customerRequest} />
           <Route exact path="/" component={Login} />
           <Route exact path="/register" component={Register} />


           {/* ENED WEIGHT LOSS EXERCISES */}


         </Router>
    </div>




  );
}

export default App;
